import { Route, BrowserRouter, Routes } from 'react-router-dom';
import Home from './Pages/Home'
import Chat from './Pages/Chat'

import './App.css';

function App() {
  return (
    <div className="App">
     <BrowserRouter>
      <Routes>
      <Route path="/" element={<Home/>}/>
      <Route path="/chats" element={<Chat/>}/>
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
